
import joblib
import streamlit as st
import pandas as pd

Model = joblib.load("Model_Final.pkl")
Inputs = joblib.load("Inputs_Final.pkl")

def prediction(online_order, book_table, location, rest_type, cuisines,
               approx_cost, listed_in_type, listed_in_city, has_menu, has_favorite_dish):
    # Create a test dataframe with the selected inputs
    test_df = pd.DataFrame(columns=Inputs)
    test_df.at[0, 'online_order'] = online_order
    test_df.at[0, 'book_table'] = book_table
    test_df.at[0, 'location'] = location
    test_df.at[0, 'rest_type'] = rest_type
    test_df.at[0, 'cuisines'] = cuisines
    test_df.at[0, 'approx_cost(for two people)'] = approx_cost
    test_df.at[0, 'listed_in(type)'] = listed_in_type
    test_df.at[0, 'listed_in(city)'] = listed_in_city
    test_df.at[0, 'has_menu'] = has_menu
    test_df.at[0, 'has_favorite_dish'] = has_favorite_dish
    
    # Predict using the model and return the result
    result = Model.predict(test_df)
    return result[0]

